import React, { useState, useEffect } from 'react';
import videosData from './videosData.json';

const VideoList = () => {
  const [videos, setVideos] = useState([]);

  useEffect(() => {
    setVideos(videosData);
  }, []);

  return (
    <div>
      {videos.map((video) => (
        <VideoComponent key={video.id} video={video} />
      ))}
    </div>
  );
};

export default VideoList;
